import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Profile = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem("token");

  const [userInfo, setUserInfo] = useState(null);
  const [adminProducts, setAdminProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [hoverStates, setHoverStates] = useState({});

  useEffect(() => {
    if (!token) {
      setError("No token found. Please log in.");
      setLoading(false);
      navigate("/login");
      return;
    }

    const fetchUserInfo = async () => {
      try {
        const response = await axios.get(
          "http://localhost:5000/api/users/profile",
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );

        const user = response.data;
        setUserInfo(user);

        if (user.isAdmin && user.productsAdded?.length > 0) {
          const productPromises = user.productsAdded.map((id) =>
            axios.get(`http://localhost:5000/api/products/${id}`)
          );
          const productResponses = await Promise.all(productPromises);
          setAdminProducts(productResponses.map((res) => res.data));
        }
      } catch (err) {
        console.error("Error:", err);
        if (err.response?.status === 401) {
          localStorage.removeItem("token");
          navigate("/login");
        }
        setError(err.response?.data?.message || "Failed to fetch data");
      } finally {
        setLoading(false);
      }
    };

    fetchUserInfo();
  }, [token, navigate]);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  const handleProductClick = (id) => {
    navigate(`/product/${id}`);
  };

  const handleMouseEnter = (productId) => {
    setHoverStates((prev) => ({ ...prev, [productId]: true }));
  };

  const handleMouseLeave = (productId) => {
    setHoverStates((prev) => ({ ...prev, [productId]: false }));
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.header}>User Profile</h2>
      {loading ? (
        <div style={styles.loadingContainer}>
          <div style={styles.spinner}></div>
          <p>Loading your profile...</p>
        </div>
      ) : error ? (
        <p style={styles.errorText}>{error}</p>
      ) : userInfo ? (
        <div style={styles.profileContainer}>
          <div style={styles.userInfoSection}>
            <h3 style={styles.username}>{userInfo.name}</h3>
            <p style={styles.infoText}>Email: {userInfo.email}</p>
            <p style={styles.infoText}>
              Joined: {new Date(userInfo.createdAt).toLocaleDateString()}
            </p>
            <p style={styles.infoText}>
              Role: {userInfo.isAdmin ? "Administrator" : "User"}
            </p>
          </div>

          {userInfo.isAdmin && (
            <div style={styles.adminSection}>
              <h3 style={styles.sectionTitle}>Your Added Products</h3>
              {adminProducts.length > 0 ? (
                <div style={styles.productsList}>
                  {adminProducts.map((product) => (
                    <div
                      key={product._id}
                      style={{
                        ...styles.productItem,
                        ...(hoverStates[product._id]
                          ? styles.productItemHover
                          : {}),
                      }}
                      onClick={() => handleProductClick(product._id)}
                      onMouseEnter={() => handleMouseEnter(product._id)}
                      onMouseLeave={() => handleMouseLeave(product._id)}
                    >
                      <img
                        src={product.image}
                        alt={product.name}
                        style={styles.productImage}
                      />
                      <div style={styles.productDetails}>
                        <strong style={styles.productTitle}>
                          {product.name}
                        </strong>
                        <p style={styles.productPrice}>
                          ${product.price.toFixed(2)}
                        </p>
                        <p style={styles.productCategory}>{product.category}</p>
                      </div>
                    </div>
                  ))}
                </div>
              ) : (
                <p style={styles.noProductsText}>No products added yet</p>
              )}
            </div>
          )}

          <button
            onClick={handleLogout}
            style={styles.logoutBtn}
            onMouseEnter={(e) =>
              (e.currentTarget.style.backgroundColor = "#c82333")
            }
            onMouseLeave={(e) =>
              (e.currentTarget.style.backgroundColor = "#dc3545")
            }
          >
            Logout
          </button>
        </div>
      ) : (
        <p>Please log in to view your profile.</p>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: "2rem",
    maxWidth: "900px",
    margin: "2rem auto",
    backgroundColor: "#f4f7fa",
    borderRadius: "12px",
    boxShadow: "0 8px 24px rgba(0, 0, 0, 0.06)",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  },
  header: {
    color: "#2c3e50",
    textAlign: "center",
    marginBottom: "1.5rem",
  },
  loadingContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    padding: "2rem",
  },
  spinner: {
    border: "4px solid rgba(0, 0, 0, 0.1)",
    width: "36px",
    height: "36px",
    borderRadius: "50%",
    borderLeftColor: "#09f",
    animation: "spin 1s linear infinite",
    marginBottom: "1rem",
  },
  profileContainer: {
    backgroundColor: "#ffffff",
    padding: "2rem",
    borderRadius: "12px",
    boxShadow: "0 4px 12px rgba(0, 0, 0, 0.08)",
    marginBottom: "2rem",
    border: "1px solid #e0e0e0",
  },
  userInfoSection: {
    marginBottom: "2rem",
    paddingBottom: "1.5rem",
    borderBottom: "1px solid #eee",
  },
  username: {
    fontSize: "1.8rem",
    fontWeight: "700",
    color: "#2c3e50",
    marginBottom: "0.5rem",
  },
  infoText: {
    fontSize: "1.1rem",
    color: "#555",
    margin: "0.5rem 0",
    lineHeight: "1.5",
  },
  logoutBtn: {
    padding: "0.6rem 1.4rem",
    backgroundColor: "#dc3545",
    color: "#fff",
    border: "none",
    borderRadius: "8px",
    cursor: "pointer",
    marginTop: "1.5rem",
    fontSize: "1rem",
    transition: "all 0.3s ease",
    width: "100%",
    maxWidth: "200px",
  },
  errorText: {
    color: "#dc3545",
    fontSize: "1.2rem",
    fontWeight: "500",
    marginTop: "1rem",
    textAlign: "center",
    padding: "1rem",
    backgroundColor: "#f8d7da",
    borderRadius: "8px",
    border: "1px solid #f5c6cb",
  },
  adminSection: {
    marginTop: "2rem",
    backgroundColor: "#e9f2ff",
    padding: "1.5rem",
    borderRadius: "10px",
    border: "1px solid #d0e3ff",
  },
  sectionTitle: {
    color: "#2c3e50",
    marginBottom: "1.2rem",
  },
  noProductsText: {
    textAlign: "center",
    color: "#666",
    fontStyle: "italic",
    margin: "1rem 0",
  },
  productsList: {
    marginTop: "1.5rem",
    display: "flex",
    flexDirection: "column",
    gap: "1.2rem",
  },
  productItem: {
    display: "flex",
    alignItems: "center",
    gap: "1.5rem",
    padding: "1rem",
    backgroundColor: "#ffffff",
    borderRadius: "10px",
    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.05)",
    transition: "all 0.3s ease",
    border: "1px solid #e6e6e6",
    cursor: "pointer",
  },
  productItemHover: {
    transform: "translateY(-2px)",
    boxShadow: "0 6px 12px rgba(0, 0, 0, 0.1)",
    borderColor: "#007bff",
  },
  productImage: {
    width: "80px",
    height: "80px",
    objectFit: "cover",
    borderRadius: "8px",
    border: "1px solid #ddd",
  },
  productDetails: {
    display: "flex",
    flexDirection: "column",
    flexGrow: 1,
  },
  productTitle: {
    fontSize: "1.1rem",
    fontWeight: "600",
    color: "#333",
    marginBottom: "0.3rem",
  },
  productPrice: {
    fontSize: "1rem",
    fontWeight: "700",
    color: "#28a745",
    marginBottom: "0.3rem",
  },
  productCategory: {
    fontSize: "0.9rem",
    color: "#6c757d",
    fontStyle: "italic",
  },
};

export default Profile;
